import 'materialize-css';
import { Carousel } from 'react-materialize';

function App() {
  return (
    <div>
              <Carousel images={[
          'https://lorempixel.com.br/250/250/nature/1',
          'https://lorempixel.com.br/250/250/nature/2',
          'https://lorempixel.com.br/250/250/nature/3',
          'https://lorempixel.com.br/250/250/nature/4',
          'https://lorempixel.com.br/250/250/nature/5'
        ]} />
    </div>
  );
}

export default App;
